import * as tf from '@tensorflow/tfjs'
import React, {useCallback, useEffect, useRef, useState} from "react";
import Webcam from "react-webcam";
import {initializeImageBase64, initializeImageTensor} from "../controller/redux/imageSlice";
import {useDispatch, useSelector} from "react-redux";
import TrueAnomaly from "../modelImporter";
// import {tensor} from "@tensorflow/tfjs-node";
// const WebcamComponent = () => <Webcam />;

const IntToString = {
    "10": "ten",
    "20": "twenty",
    "50": "fifty",
    "100": "hundred",
    "200": "two hundred",
    "500": "five hundred",
    "2000": "two thousand",
    'Undetected': 'Undetected'
}

const videoConstraints = {

    facingMode: {exact: "environment"},
    width: 500,
    height: 950,
};


export default function ScanPage() {

    let [price, setPrice] = useState(null);
    const dispatch = useDispatch();
    const {value} = useSelector((store) => store.image);


    let webcamRef = useRef(null);
    const [imgSrc, setImgSrc] = React.useState(null);


    const pageTitle = new SpeechSynthesisUtterance();
    pageTitle.text = "Hello Welcome to the scan page, plz scan your currency";
    let synth = window.speechSynthesis;

    useEffect(() => {

        !imgSrc && synth.speak(pageTitle)
    }, [pageTitle])


    let capture = useCallback(() => {
        let scanMessage = new SpeechSynthesisUtterance();
        scanMessage.text = 'Scanning Your currency Please be patient';
        synth.speak(scanMessage);
        let imageSrc = webcamRef.current.getScreenshot();
        setImgSrc(imageSrc);
        //console.log(imageSrc);
        trial(imageSrc);
    }, [webcamRef, setImgSrc]);


    function trial(ss) {

        let image = new Image();
        //console.log(ss);
        //image.src = "data:image/jpeg;base64,"
        image.src = ss;
        image.height = 224;
        image.width = 224;
        image.onload = () => {
            // console.log(image)
            let tensor = tf.browser.fromPixels(image);
            console.log(tensor);
            Promise.resolve(tensor).then(async r => {
                console.log(tensor);
                let output = TrueAnomaly(tensor);
                Promise.resolve(output).then(async rr => {
                    let priceText = new SpeechSynthesisUtterance();

                    setPrice(rr);
                    priceText.text = `Currency Scanned, The value of scanned currency is ${IntToString[rr.toString()]} ${rr.toString() === "Undetected" ? "" : "rupee"}`;
                    // console.log(`Currency Scanned, The value of scanned currency is ${IntToString[rr.toString()]}`)
                    synth.speak(priceText);
                })
            });
        }
    }


    function retry() {
        let RescanMessage = new SpeechSynthesisUtterance();
        RescanMessage.text = 'Re Scan';
        synth.speak(RescanMessage);
        setImgSrc(null);
        setPrice(null);
    }


    return (
        <div className={"ScanPage"}>
            <div className={"Appbar"}/>
            <div className={"Webcam"}>
                {imgSrc == null ? <Webcam
                    // height={"1000"}
                    // width={"750"}
                    audio={false}
                    ref={webcamRef}
                    mirrored={false}
                    videoConstraints={videoConstraints}
                    screenshotFormat="image/jpeg"
                /> : <img
                    id={"special"}
                    src={imgSrc}
                    alt={"image"}/>}
            </div>

            <button disabled={price == null && imgSrc != null} className={"Capture"}
                    onClick={imgSrc == null ? capture : retry}>{imgSrc == null ? "Scan" : "Re-Scan"}</button>
            <div>

                <div className={"Anomaly"}>{imgSrc && price}</div>
            </div>


        </div>
    );
}
